import React from 'react';
import Navbar from "./components/Navbar";
import Details from "./pages/details"

function App() {
  return (
    <div className="flex">
      <div className="w-1/6 bg-gray-100 h-screen">
        <Navbar />
      </div>
      <div className="flex-1">
      <Details/>
      </div>
    </div>
  );
}

export default App;
